import React from 'react';
import { Nav, NavbarContainer, NavLogo } from './navBarElements';
import logo from '../../images/logo.png';

const Navbar = () => {
  return (
    <>
       <Nav>
            <NavbarContainer>
                <NavLogo to='/'><img src={logo} height={80} width={60} alt='logo' /></NavLogo>
                <h1>Hey </h1>
            </NavbarContainer>
       </Nav>
    </>
  );
};

export default Navbar;
